  input: "TEXT\x1CC00001313\x1CTEXT.1\x1C\x1CF3XA\x1CPer discussion with our RAD Analyst,
    Line 29 discloses two disbursements to Alliance Bank totaling $10,944.  Please
    be advised that during the month of February, the Republican Party of Minnesota
    wrote two checks that were cleared by the bank twice.  In March, the bank corrected
    this error and deposited the money back into the account.  The April Monthly Report
    (3/01/08 - 3/31/08) will show two refunds from Alliance Bank on Line 15 totaling
    $10,944.  Schedule B, supporting Line 21(b), discloses a voided check to Pamela
    Finney.  Please be advised that the salary payment to Pamela Finney was intended
    for Raymond Forrest.  When this error was realized, the paycheck to Pamela Finney
    was voided, and correctly re-issued to Raymond Forrest.  Therefore, no in-kind
    contribution was received from Pamela Finney\x1C\n"
